import React, { useEffect } from 'react';

const DailyScorePopup = ({ dailyData }) => {
  // Log the full dailyData object to ensure it is passed correctly
  useEffect(() => {
    console.log('Props passed to DailyScorePopup:', dailyData);
    if (dailyData && dailyData.aggregated_data) {
      console.log('aggregated_data is present:', dailyData.aggregated_data);
    } else {
      console.log('aggregated_data is undefined or empty.');
    }
  }, [dailyData]);

  if (!dailyData) {
    console.log('No valid dailyData available for rendering.');
    return <p>No daily data available.</p>;
  }

  // Safely extract aggregated_data
  const aggregatedData = dailyData.aggregated_data || {};
  
  const speedKmh = aggregatedData['Speed(km/h)'] ?? 'N/A';
  const acceleration = aggregatedData['Acceleration(m/s^2)'] ?? 'N/A';
  const jerk = isNaN(aggregatedData['Jerk(m/s^3)']) ? 'N/A' : aggregatedData['Jerk(m/s^3)'];
  const brakingIntensity = aggregatedData['Braking_Intensity'] ?? 'N/A';
  const sasv = aggregatedData['SASV'] ?? 'N/A';
  const speedViolation = aggregatedData['Speed_Violation'] ?? 'N/A';
  const headingChange = aggregatedData['Heading_Change(degrees)'] ?? 'N/A';

  const drivingScore = dailyData.driving_score || 'N/A';
  const drivingCategory = dailyData.driving_category || 'N/A';
  const totalDistanceCovered = dailyData.total_distance_covered_km || 'N/A';

  return (
    <div className="daily-score-popup">
      <h3>Daily Driving Summary</h3>
      <div className="summary-container">
        <div className="summary-item">
          <h4>Driving Score</h4>
          <p>{drivingScore} / 100</p>
        </div>
        <div className="summary-item">
          <h4>Driving Category</h4>
          <p>{drivingCategory}</p>
        </div>
        <div className="summary-item">
          <h4>Total Distance Covered</h4>
          <p>{totalDistanceCovered} km</p>
        </div>
        <div className="summary-item">
          <h4>Average Speed</h4>
          <p>{speedKmh} km/h</p>
        </div>
        <div className="summary-item">
          <h4>Acceleration</h4>
          <p>{acceleration} m/s²</p>
        </div>
        <div className="summary-item">
          <h4>Jerk</h4>
          <p>{jerk} m/s³</p>
        </div>
        <div className="summary-item">
          <h4>Braking Intensity</h4>
          <p>{brakingIntensity}</p>
        </div>
        <div className="summary-item">
          <h4>Heading Change</h4>
          <p>{headingChange} degrees</p>
        </div>
        <div className="summary-item">
          <h4>Speed Violations</h4>
          <p>{speedViolation}</p>
        </div>
        <div className="summary-item">
          <h4>SASV (Sudden Acceleration/Speed Violation)</h4>
          <p>{sasv}</p>
        </div>
      </div>
    </div>
  );
};

export default DailyScorePopup;
